import React, {Component} from 'react';
import './style.css';
import 'bootstrap/dist/css/bootstrap.min.css';


class Navbar extends Component {

    render() {
        return (
            <div class="nav_body">
                <div class="pad20 nav_header">
                    <h1 class="font_white">撸猫记录</h1>
                </div>

                <div class="square_panel">
                    <div class="day_count">1</div>
                    <div><button type="button" class="btn btn-primary">打卡</button></div>

                </div>
            </div>

        );
    }

}

export default Navbar;
